import React, {Component} from 'react';
import Conn from "./Conn";

class Connect extends Component {
    constructor(props){
        super(props);
    }
    render() {

        var imgUrl_2 = '../img/design.jpg';
        const style_2 = {
            backgroundImage: 'url("'+imgUrl_2+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_3 = '../img/build.png';
        const style_3 = {
            backgroundImage: 'url("'+imgUrl_3+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_4 = '../img/domain.png';
        const style_4 = {
            backgroundImage: 'url("'+imgUrl_4+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_5 = '../img/host.jpg';
        const style_5 = {
            backgroundImage: 'url("'+imgUrl_5+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_6 = '../img/seotop.jpg';
        const style_6 = {
            backgroundImage: 'url("'+imgUrl_6+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };

        return (
            <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                        <ul className="timeline">
                        <Conn connclass="" style={style_2}  conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line="line"/>
                        <Conn connclass="timeline-inverted" style={style_3}  conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line="line"/>
                        <Conn connclass="" conntitle="Company" style={style_4} conncontent="Tạo ra sản phẩm tốt nhất cho kH" line="line"/>
                        <Conn connclass="timeline-inverted" style={style_5}  conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line="line"/>
                        <Conn connclass="" style={style_6} conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line=""/>
                        </ul>
                    </div>
                </div>
            </div>
        );
    }
}

export default Connect;
